import { Link } from "react-router-dom";

const UserRoutes = () => {
    return (
        <div>
            <ul>
                <li>
                    <Link to={`/profile`}> Profile </Link>
                </li>
                <li>
                    <Link to={`/userdashboard`}> User Dashboard </Link>
                </li>
            </ul>
            <h1>Welcome User!!!</h1>
        </div>
    );
};

export default UserRoutes;
